import { Layout } from "../components/Layout";
import axios from "axios";
import { Component } from "react";
import Table from "react-bootstrap/Table";
export default class Payments extends Component {
  static async getInitialProps() {
    const res = await axios.get("/api/payments/");
    const statusCode = res.status > 200 ? res.status : false;
    // const data = await res.json();
    console.log(res)
    return { user: data, statusCode };
  }

  render() {
    return (
      <Layout title="Payments">
        <Table striped bordered hover responsive>
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Country</th>
              <th>City</th>
              <th>Type Payment</th>
              <th>Due</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>1</td>
              <td>Table cell</td>
              <td>Table cell</td>
              <td>Table cell</td>
              <td>Table cell</td>
              <td>Table cell</td>
              <td>Table cell</td>
            </tr>
            <tr>
              <td>2</td>
              <td>Table cell</td>
              <td>Table cell</td>
              <td>Table cell</td>
              <td>Table cell</td>
              <td>Table cell</td>
              <td>Table cell</td>
            </tr>
            <tr>
              <td>3</td>
              <td>Table cell</td>
              <td>Table cell</td>
              <td>Table cell</td>
              <td>Table cell</td>
              <td>Table cell</td>
              <td>Table cell</td>
            </tr>
          </tbody>
        </Table>
      </Layout>
    );
  }
}
